import React from "react";
import Layout from "../components/Layout";
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import LocationOnIcon from '@mui/icons-material/LocationOn';
import EmailIcon from '@mui/icons-material/Email';
import CallIcon from '@mui/icons-material/Call';

const Contact = () => {
  return (
    <>
      <Layout title={"PhoenixTech-Contact"}>
        <Container maxWidth="xl">
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3684.1039987526487!2d88.42485957475722!3d22.575213332875617!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a0275927b0061ad%3A0x496c2fab98874c86!2sWebskitters%20Technology%20Solutions%20Pvt.%20Ltd.!5e0!3m2!1sen!2sin!4v1697779293665!5m2!1sen!2sin"
            width="100%"
            height="450"
            style={{ border: 0 }}
            allowfullscreen=""
            loading="lazy"
            referrerpolicy="no-referrer-when-downgrade"
          ></iframe>
        </Container>
        <Container maxWidth="sm">
          <Grid
            container
            rowSpacing={1}
            columnSpacing={{ xs: 1, sm: 2, md: 3 }}
            direction={{ xs: "column", md: "row" }}
            justifyContent={{ xs: "center", md: "flex-end" }}
            alignItems={{ xs: 'center', md: 'flex-end' }}
            m={5}
            sx={{boxShadow: "0px 0px 30px rgbe(0,0,0,0.5)"}}
          >
            <Grid item xs={4} p={4}>
              <Typography variant="h5" fontWeight="bold"> <LocationOnIcon fontSize="large"/> Location</Typography>
            </Grid>
            <Grid item xs={4} p={4}>
            <Typography variant="h5" fontWeight="bold"><EmailIcon fontSize="Large"/>Email</Typography>
            </Grid>
            <Grid item xs={4} p={4}>
            <Typography variant="h5" fontWeight="bold"><CallIcon fontSize="large"/> Call</Typography>
            </Grid>
          </Grid>
        </Container>
      </Layout>
    </>
  );
};

export default Contact;
